tables.table_schema:
CREATE TABLE training_session (
    training_session_id INT PRIMARY KEY,
    session_date DATE,
    session_duration INT,
    video_path VARCHAR(255)
);

CREATE TABLE performance_feedback (
    feedback_id INT PRIMARY KEY,
    training_session_id INT,
    feedback_text TEXT,
    feedback_video_path VARCHAR(255),
    FOREIGN KEY (training_session_id) REFERENCES training_session(training_session_id)
);

CREATE TABLE TrainingSessions (
  session_id INT PRIMARY KEY,
  session_date DATE,
  location VARCHAR(255),
  coach_id INT
);

CREATE TABLE Athletes (
  athlete_id INT PRIMARY KEY,
  name VARCHAR(255),
  age INT,
  skill_level VARCHAR(50)
);

CREATE TABLE VideoFootage (
  footage_id INT PRIMARY KEY,
  session_id INT,
  athlete_id INT,
  video_link TEXT
);

CREATE TABLE Techniques (
    technique_id INT PRIMARY KEY,
    technique_name TEXT,
    description TEXT
);

CREATE TABLE Coaches (
    coach_id INT PRIMARY KEY,
    coach_name TEXT,
    coach_email TEXT
);

CREATE TABLE training_sessions (
    session_id INT PRIMARY KEY,
    session_date DATE,
    coach_id INT,
    video_url VARCHAR
);

CREATE TABLE techniques (
    technique_id INT PRIMARY KEY,
    technique_name VARCHAR,
    description TEXT
);
